import React from 'react';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Card from 'react-bootstrap/Card';
import '../components/styles/ListadoFotos.css';
import iconoNofovotiro from '../like.png';


function ListadoFotos(){

    return(
   
         <Row>

             <Col md={4} lg={3} xs={12} className=" mb-4 ml-1">
                 
             <Card className="cardImg"> 
                 <Card.Body className="cardBodyImg">

                 <img src="https://cdn.pixabay.com/photo/2015/04/23/21/59/tree-736875__340.jpg" className="card-img-top"></img>
                 
                    <Card.Footer>
                        <a className="nav.link text-right"  href="#">
                            <img src={iconoNofovotiro}></img>
                        </a>
                        <p className="plistado">hola</p>
                        
                        </Card.Footer>

                 </Card.Body>
             </Card>
             </Col>

         </Row>
       
    );
}

export default ListadoFotos;
